def run(value_list):
    """
    Calculates the year on year percentage change in domestic discount rate between 2018 and 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    discount_rates = []
    for item in value_list:
        if item['category'] == 'Discount rate' and item['header3'] == 'Domestic':
            discount_rates.append(float(item['number_value']))

    if len(discount_rates) < 2:
        return (0.00, '')

    rate_2018 = discount_rates[0]
    rate_2019 = discount_rates[1]

    change = rate_2019 - rate_2018
    percentage_change = (change / rate_2018) * 100

    return (round(percentage_change, 2), 'percent')

