def run(value_list):
    """
    Calculates the average difference between EBITDA and underlying EBITDA for both FYs.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    fy2019_ebitda = []
    fy2019_underlying_ebitda = []
    fy2018_ebitda = []
    fy2018_underlying_ebitda = []

    for item in value_list:
        if item['header2'] == '30 June 2019':
            if item['category'] == 'EBITDA':
                fy2019_ebitda.append(float(item['number_value']))
            elif item['category'] == 'Underlying EBITDA':
                fy2019_underlying_ebitda.append(float(item['number_value']))
            elif item['category'] == 'Add: APDC transaction costs':
                pass
            elif item['category'] == 'Add: Singapore and Japan costs':
                pass
            elif item['category'] == 'Add: landholder duty on acquisition of APDC properties':
                pass

        elif item['header2'] == '30 June 2018':
            if item['category'] == 'EBITDA':
                fy2018_ebitda.append(float(item['number_value']))
            elif item['category'] == 'Underlying EBITDA':
                fy2018_underlying_ebitda.append(float(item['number_value']))
            elif item['category'] == 'Add: APDC transaction costs':
                pass
            elif item['category'] == 'Add: Singapore and Japan costs':
                pass
            elif item['category'] == 'Add: landholder duty on acquisition of APDC properties':
                pass

    if len(fy2019_ebitda) > 0 and len(fy2019_underlying_ebitda) > 0:
        avg_diff_2019 = sum(abs(x - y) for x, y in zip(fy2019_ebitda, fy2019_underlying_ebitda)) / len(fy2019_ebitda)
    else:
        avg_diff_2019 = 0

    if len(fy2018_ebitda) > 0 and len(fy2018_underlying_ebitda) > 0:
        avg_diff_2018 = sum(abs(x - y) for x, y in zip(fy2018_ebitda, fy2018_underlying_ebitda)) / len(fy2018_ebitda)
    else:
        avg_diff_2018 = 0

    return (round(avg_diff_2019, 2), 'thousand')

