def run(value_list):
    """
    Calculates the average Electricity, heat, steam and cooling purchased for own use (Scope 2)
    for FY18 and FY19 for UK and Ireland only.

    Args:
        value_list: A list of dictionaries containing financial report data.

    Returns:
        A tuple (number, scale).
    """
    scope2_values = [
        item for item in value_list if item['category'] == 'Electricity, heat, steam and cooling purchased for own use (Scope 2)'
        ]

    fy18_scope2 = [item for item in scope2_values if item['header1'] == 'FY18**']
    fy19_scope2 = [item for item in scope2_values if item['header1'] == 'FY19**']

    if not fy18_scope2 or not fy19_scope2:
        return (0.00, "")

    total_fy18 = sum([item['number_value'] for item in fy18_scope2])
    total_fy19 = sum([item['number_value'] for item in fy19_scope2])

    average = (total_fy18 + total_fy19) / 2

    if average == 0:
        return (0.00, "")

    if average < 1000000:
        scale = "thousand"
    elif average < 100000000:
        scale = "million"
    elif average < 1000000000:
        scale = "billion"
    else:
        scale = ""

    return (round(average, 2), scale)

