    for item in value_list:
        if item['category'] == 'Euro':
            euro_assets.append(item)

    total_euro_assets = sum(item['number_value'] for item in euro_assets)

    interest_bearing_euro_assets = 0
    for item in euro_assets:
        if item['category'] != 'Other':
            interest_bearing_euro_assets += item['number_value']

    total_assets = sum(item['number_value'] for item in euro_assets)

    if total_assets == 0:
        return (0.00, '')

    percentage = (interest_bearing_euro_assets / total_assets) * 100

    return (round(percentage, 2), 'percent')

