def run(value_list):
    """
    Calculates the average financing costs between 2018 and 2019 based on the provided financial report.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average financing costs between 2018 and 2019.
    """
    costs_2018 = []
    costs_2019 = []

    for item in value_list:
        if item['header2'] == '2018':
            costs_2018.append(item['number_value'])
        elif item['header2'] == '2019':
            costs_2019.append(item['number_value'])

    if not costs_2018 and not costs_2019:
        return (0.00, "")
    elif not costs_2018:
        return (sum(costs_2019) / len(costs_2019) if costs_2019 else 0.00, "")
    elif not costs_2019:
        return (sum(costs_2018) / len(costs_2018) if costs_2018 else 0.00, "")
    else:
        average_cost = (sum(costs_2018) + sum(costs_2019)) / (len(costs_2018) + len(costs_2019))
        if average_cost == 0.00:
            return (0.00, "")
        else:
            return (round(average_cost, 2), "")

def run(value_list):
    """
    Calculates the difference between the average investment income and average financing costs.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the difference.
    """
    investment_income = []
    financing_costs = []

    for item in value_list:
        if item['category'] == 'Investment income':
            investment_income.append(item['number_value'])
        elif item['category'] == 'Financing costs':
            financing_costs.append(item['number_value'])

    if not investment_income or not financing_costs:
        return (0.00, "")

    avg_investment_income = sum(investment_income) / len(investment_income)
    avg_financing_costs = sum(financing_costs) / len(financing_costs)

    difference = avg_investment_income - avg_financing_costs

    return (round(difference, 2), "")

