def run(value_list):
    """
    Calculates the percentage increase of GAAP-based Professional Service and Other Gross Profit from 2017 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the percentage increase.
    """

    # Extract data for 2017 and 2019
    try:
        gross_profit_2017 = float(value_list[0]['number_value'])
        gross_profit_2019 = float(value_list[13]['number_value'])
    except (KeyError, ValueError):
        return (0.00, "")

    # Calculate the percentage increase
    try:
        increase = ((gross_profit_2019 - gross_profit_2017) / gross_profit_2017) * 100
    except ZeroDivisionError:
        return (0.00, "")

    return (round(increase, 2), "")

def run(value_list):
    """
    Calculates the proportion of long-term debt payments due in 5 years or below.

    Args:
        value_list: A list of dictionaries containing financial report data.

    Returns:
        A tuple (number, scale) representing the proportion, rounded to two decimal places.
    """
    long_term_debt_5_years_or_below = 0
    total_long_term_debt = 0

    for item in value_list:
        if item['category'] == 'Long-term debt .':
            if item['header1'] in ['1-3 Years', '3-5 Years', 'After 5 Years']:
                long_term_debt_5_years_or_below += item['number_value']
                total_long_term_debt += item['number_value']

    if total_long_term_debt == 0:
        return (0.00, '')

    proportion = (long_term_debt_5_years_or_below / total_long_term_debt) * 100
    return (round(proportion, 2), 'percent')

def run(value_list):
