            elif item['header1'] == '2019':
                telecommunication_maintenance_2019 = item['number_value']

    if telecommunication_maintenance_2018 is not None and telecommunication_maintenance_2019 is not None:
        increase_decrease = telecommunication_maintenance_2019 - telecommunication_maintenance_2018
        return (round(increase_decrease, 2), 'thousand')
    else:
        return (None, None)

def run(value_list):
    telecommunication_installation_2019 = 0
    telecommunication_installation_2018 = 0
    count = 0
    for item in value_list:
        if item['category'] == 'Telecommunication - Installation':
            telecommunication_installation_2019 += item['number_value']
            telecommunication_installation_2018 += item['number_value']
            count += 1
    if count > 0:
        average = (telecommunication_installation_2019 + telecommunication_installation_2018) / 2
    else:
        average = 0
    return (round(average, 2), '')
